import Grid from "@mui/material/Grid";
import Typography from "@mui/material/Typography";
import Box from "@mui/material/Box";
import Stack from "@mui/material/Stack";
import Container from "@mui/material/Container";
import CurrencyBitcoinIcon from "@mui/icons-material/CurrencyBitcoin";
import TravelExploreIcon from "@mui/icons-material/TravelExplore";
import AppRegistrationIcon from "@mui/icons-material/AppRegistration";

const HeroSection = () => {
    return (
        <Box sx={{ py: 8, position: "relative" }} id="herosection">
            {/* Background Image */}
            <Box
                component="img"
                src="/back.png"  // Path to the public folder image
                alt="Hero Background"
                sx={{
                    width: "100%",
                    height: { xs: "300px", sm: "500px" },
                    objectFit: "cover",
                    objectPosition: "center",
                    mb: 4,
                }}
            />

            <Container maxWidth="lg">
                <Grid container spacing={5} alignItems="center" justifyContent="center">
                    {/* Right Side: Content */}
                    <Grid item xs={12} md={6}>
                        <Typography
                            variant="h4"
                            component="h2"
                            sx={{ fontWeight: "bold", mb: 3, color: "#363636", textAlign: { xs: "center" } }}
                        >
                            Welcome to Alkebuleum
                        </Typography>

                        {/* Description Content */}
                        <Typography
                            variant="body1"
                            color="textSecondary"
                            sx={{ mb: 4, lineHeight: 1.7, textAlign: { xs: "center" } }}
                        >
                            Pan-African Blockchain network powering decentralized applications that address real-world challenges.
                        </Typography>

                        {/* List of Square Buttons with Hover Effect */}
                        <Stack direction="row" spacing={2} justifyContent="center" sx={{ mt: 4 }}>
                            {/* Button 1: Get AKE */}
                            <Box
                                sx={{
                                    display: "flex",
                                    flexDirection: "column",
                                    alignItems: "center",
                                    borderRadius: "16px",
                                    border: "2px solid #D0E9EF", // Outline color (beige-brown)
                                    padding: 2,
                                    width: 120, // Reduced size
                                    height: 120, // Reduced size
                                    textAlign: "center",
                                    backgroundColor: "transparent", // No background color
                                    transition: "all 0.3s ease", // Smooth transition
                                    "&:hover": {
                                        backgroundColor: "#f9d0ba", // Change background on hover
                                        color: "#fff", // Change text color on hover
                                    },
                                }}
                            >
                                <CurrencyBitcoinIcon sx={{ fontSize: 35, color: "#8b4513", mb: 1 }} /> {/* Dark brown color */}
                                <Typography variant="body2" fontWeight="bold" color="#8b4513">
                                    Get AKE
                                </Typography>
                            </Box>

                            {/* Button 2: Block Explorer */}
                            <Box
                                sx={{
                                    display: "flex",
                                    flexDirection: "column",
                                    alignItems: "center",
                                    borderRadius: "16px",
                                    border: "2px solid #D0E9EF", // Outline color (beige-brown)
                                    padding: 2,
                                    width: 120, // Reduced size
                                    height: 120, // Reduced size
                                    textAlign: "center",
                                    backgroundColor: "transparent", // No background color
                                    transition: "all 0.3s ease", // Smooth transition
                                    "&:hover": {
                                        backgroundColor: "#f9d0ba", // Change background on hover
                                        color: "#fff", // Change text color on hover
                                    },
                                }}
                            >
                                <TravelExploreIcon sx={{ fontSize: 35, color: "#8b4513", mb: 1 }} /> {/* Dark brown color */}
                                <Typography variant="body2" fontWeight="bold" color="#8b4513">
                                    Block Explorer
                                </Typography>
                            </Box>

                            {/* Button 3: Try Apps */}
                            <Box
                                sx={{
                                    display: "flex",
                                    flexDirection: "column",
                                    alignItems: "center",
                                    borderRadius: "16px",
                                    border: "2px solid #D0E9EF", // Outline color (beige-brown)
                                    padding: 2,
                                    width: 120, // Reduced size
                                    height: 120, // Reduced size
                                    textAlign: "center",
                                    backgroundColor: "transparent", // No background color
                                    transition: "all 0.3s ease", // Smooth transition
                                    "&:hover": {
                                        backgroundColor: "#f9d0ba", // Change background on hover
                                        color: "#fff", // Change text color on hover
                                    },
                                }}
                            >
                                <AppRegistrationIcon sx={{ fontSize: 35, color: "#8b4513", mb: 1 }} /> {/* Dark brown color */}
                                <Typography variant="body2" fontWeight="bold" color="#8b4513">
                                    Try Apps
                                </Typography>
                            </Box>
                        </Stack>
                    </Grid>
                </Grid>
            </Container>
        </Box>
    );
};

export default HeroSection;
